import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'

export function BluePill(props) {
  const group = useRef()
  const { nodes, materials } = useGLTF('/BluePill/BluePill.gltf')
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="BluePill" geometry={nodes.BluePill.geometry} material={materials['Material.001']} position={[0.39, 1.32, 0]} rotation={[-2.27, 0, -Math.PI / 2]} scale={0.75}>
          <meshStandardMaterial color="#2f55d4"/>
          <mesh name="MovingBlock2" geometry={nodes.MovingBlock2.geometry} material={materials['Material.004']} position={[0.01, -1.98, 0.02]} rotation={[-0.93, 1.2, -0.62]} scale={0.83} />
        </mesh>
      </group>
    </group>
  )
}

